var tipuesearch = {"pages":[{"text":"這學期利用ShareX來錄製影片，上傳到Vimeo來做一個紀錄的動作，剛好可以看看自己到底做了哪些東西，也方便以後來回顧，很有紀錄性跟成就感! 這次主要學到SolveSpace跟Onshape這兩個軟體，我個人覺得兩個都各有優缺點，我也比較喜歡SolveSpace這個簡單的程式，雖然它計算能力比Onshape還低，不過算是蠻好上手的，Onshape算是一個簡易型的Solidworks，以有學過的人來說應該不難，不過重點是老師要求我們的英文介面，讓這個軟體瞬間加難度，不過多去練習，基本的還算上的了手。整體說起來學的很多很開心! Solvespace 平面四連桿機構模擬 Solvespace 組合圖 Solvespace 轉 html OnShape練習 心得 今天是這學期最後一次的課程，真的是花了許多的時間學了這兩套軟體，而我很喜歡Solvespace這樣簡單又明瞭的軟體，雖然還是不太熟悉，但是卻學得很開心。而老師也教得很好，雖然時不時會嘴我們，不過卻相當有道理，之後我也會好好加油的，謝謝老師的教誨!","url":"./2016fall-dian-nao-fu-zhu-she-ji-shi-xi-ke-cheng-zong-jie.html","title":"2016Fall 電腦輔助設計實習課程總結","tags":"Misc"},{"text":"最後整理上課內容 Solvespace OnShape 個人影片區 心得 今天是第十七次上課，終於到了最後的幾堂課了，很開心學到了OnShape跟Solvespace，雖然還不算是整個學會，但至少有了解到許多的操作跟一點點的概念，雖然不知道之後還會不會再遇到這個軟體，不過以備不時之需。下禮拜期末考，要好好加油了。","url":"./di-shi-qi-zhou.html","title":"第十七週","tags":"Misc"},{"text":"上課內容 OnShape繪製Mechanism Tutorial 零件 個人影片區 心得 今天第十六次上課，又回到OnShape了，這次上課因為是元旦前一天.，所以蠻多人沒來上課，跑去跨年，剩沒幾個人留下來畫圖，看來又是個好機會了。","url":"./di-shi-liu-zhou.html","title":"第十六週","tags":"Misc"},{"text":"上課內容 3D印表機 ，並模擬它的運動軌跡。 個人影片區 心得 今天第十五次上課，講的是大家比較熟悉的東西了，這個3D印表機是個趨勢，希望我可以好好學起來。","url":"./di-shi-wu-zhou.html","title":"第十五週","tags":"Misc"},{"text":"上課內容 用SolveSpace把檔案存成html檔,並且更改成http設定,利用嵌入網頁的指令,把html檔案放進網誌裡面 影片 個人影片區 心得 今天第十四次上課，上禮拜教的OnShape還沒弄熟，這次又回來到比較熟悉的Solvespace了，不過好像蠻多人都沒來的樣子，我要好好加油了。","url":"./di-shi-si-zhou.html","title":"第十四週","tags":"Misc"},{"text":"上課內容 利用OnShape練習繪製零件。 影片 個人影片區 心得 今天第十三次上課，又交一個新的軟體OnShape，辦會員的時候很好玩，我還把名字取的很好笑，不過雖然這個軟體可以中文化，但是老師叫我們練習英文，所以用英文版的，慢慢練習囉!","url":"./di-shi-san-zhou.html","title":"第十三週","tags":"Misc"},{"text":"上課內容 利用SOLVESPACE練習繪製COLLEGE_STUDENT_PRIMER_CREO_2.PDF裡的零件並學習如何組立。 影片 個人影片區 心得 今天第十二次上課，要畫第二張圖，還不是很習慣用這個軟體，但是還是有它好用的地方，希望之後可以好好練習，弄熟這套不錯的軟體。","url":"./di-shi-er-zhou.html","title":"第十二週","tags":"Misc"},{"text":"上課內容 虎科大36週年校慶，剛好沒上課，來去看運動吧!","url":"./di-shi-yi-zhou.html","title":"第十一週","tags":"Misc"},{"text":"上課內容 有關 Solvespace 機構模擬功能介紹, 與 Python3 及 Brython 程式驗證 路徑圖 將所得到的點座標 .csv 以 Excel 畫圖。路徑圖 影片 個人影片區 心得 期中考剛考完，放送了一下，又繼續開始上課了，今天是第十次上課，這次上課開始教畫圖，這次教的是Solvespace，因為大部分都是英文，剛好可以藉此練習英文 。我這次做的時候也出現了許多問題，一開始有問題要快點解決，不然會牽連到之後，慶幸的是有些同學可以教我，讓我學得比較輕鬆一點，不過我們經過討論才知道大家還是有彼此不熟得地方，希望可以藉由之後的上課，一一克服。","url":"./di-shi-zhou.html","title":"第十週","tags":"Misc"},{"text":"期中考週","url":"./di-jiu-zhou.html","title":"第九週","tags":"Misc"},{"text":"使用Trace Point計算路徑","url":"./di-ba-zhou.html","title":"第八週","tags":"Misc"},{"text":"使用Trace Point計算路徑","url":"./di-qi-zhou.html","title":"第七週","tags":"Misc"},{"text":"感覺還不錯","url":"./di-liu-zhou.html","title":"第六週","tags":"Misc"},{"text":"##認識SolveSpace","url":"./di-wu-zhou.html","title":"第五週","tags":"Misc"},{"text":"1: 設定使用者資料 2: 組長用2016fallcadp_bg11的名稱建立小組倉儲並邀組員進入小組倉儲","url":"./di-si-zhou.html","title":"第四週","tags":"Misc"},{"text":"1:複製網誌和簡報的設定檔2016fallcadp_hw的倉儲 2:更改2016fallcadp_hw的README.md檔案","url":"./di-san-zhou.html","title":"第三週","tags":"Misc"},{"text":"1: 建立\"學號.github.io\"名稱的倉儲 2: 把分支的預設值改為gh-pages 3: 建立\"2016fallcpb_hw\"作業倉儲","url":"./di-er-zhou.html","title":"第二週","tags":"Misc"},{"text":"切換分支 cd tmp 回到上個分支 cd .. git clone 個人倉儲網址 檢查分支 git branch git add -A git commit -m\" 改版內容 \" 推送進端資料到遠端 git push origin 分支名稱","url":"./di-yi-zhou.html","title":"第一週","tags":"Misc"},{"text":"這個系統共集結了 reveal.js 網際簡報與 pelican 靜態網誌系統. 網誌 Category 網誌 Tags reveal.js 使用導引","url":"./2016fall-jian-bao-yu-wang-zhi-xi-tong.html","title":"2016Fall 簡報與網誌系統","tags":"Misc"}]};